import React from 'react'
import styled from 'styled-components';

function FolioPage() {
    return (
        <FolioStyled>
        <div className="safeview">
            <h5>some of my recent works</h5>
            <h1>Projects</h1>
        </div>
        </FolioStyled>
    )
}
const FolioStyled = styled.header`
.safeview{
    padding: 5rem;
    h5{
        text-align: center;
    }
    h1{
        text-align: center;
    }
}
`;
export default FolioPage;
